"""# TMY to Power

Αυτό το σημειωματάριο θα περιγράψει τα βήματα μοντελοποίησης της AC παροχής ισχύος μιας ΦΒ συστοιχίας, από τα δεδομένα ενός τυπικού μετεωρολογικού έτους (TMY), χρησιμοποιώντας το μοντέλο μονής διόδου.

Περιεχόμενα:  
  
1. Προσδιορισμός χαρακτηριστηκών του συστήματος φωτοβολταϊκών
2. Εισαγωγή δεδομένων Τυπικού Μετεωρολογικού Έτους
3. Υπολογισμός των ενδιάμεσων μεγεθών
4. Υπολογισμός της φωτοβολταϊκής DC ισχύος με την χρήση του μοντέλου μονής διόδου
5. Υπολογισμός της AC ισχύος της ΦΒ συστοιχίας, μετά τον αντιστροφέα

Το σημειωματάριο κάνει χρήση της βιβλιοθήκης PVLIB

Author:
* Ioannis E. Kosmadakis

## 0.   Setup

Αρχικά έχουμε τις τυπικές επιστημονικές εισαγωγές (βιβλιοθήκες) της python. Ακολούθως εισάγουμε την βιβλιοθήκη PVLIB.
"""

# Commented out IPython magic to ensure Python compatibility.
# built-in python modules
import os
import inspect

# scientific python add-ons
import numpy as np
import pandas as pd

# plotting stuff
# first line makes the plots appear in the notebook
# %matplotlib inline
import matplotlib.pyplot as plt
import matplotlib as mpl
import matplotlib.dates as mdates

# finally, we import the pvlib library
import pvlib
import pvlib.pvsystem as pvsystem

"""## 1. Αρχικά, προσδιορίζουμε τα χαρακτηριστηκά του συστήματος φωτοβολταϊκών.

Ορίζουμε:  
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;α) Γεωγραφικό Μήκος,   
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;β) Γεωγραφικό πλάτος,   
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;γ) Υψόμετρο,  
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;δ) Ζώνη Ώρας,  
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ε) Όνομα Θέσης,  
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;στ) Γωνία (κλήση) ΦΒ συστοιχίας,  
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ζ) Αζημοθυθιακή Γωνία (προσανατολισμός) της ΦΒ συστοιχίας,  
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;η) Ανακλαστηκότητα
"""

lati = 41.095
long = 24.230
alti = 103.0
tizo = "Europe/Athens"
name = "Doxato, Drama"

surface_tilt = 30
surface_azimuth = 180 # pvlib uses 0=North, 90=East, 180=South, 270=West convention
albedo = 0.25

# create pvlib Location object based on meta data
sand_point = pvlib.location.Location(lati, long, tz= tizo, altitude= alti, name= name.replace('"',''))
print(sand_point)

"""## 2. Παρακάτω εισάγουμε, από το αρχείο του PVGIS, τα αντίστοιχα δεδομένα ενός Τυπικού Μετεωρολογικού Έτους (ΤΜΥ) της περιοχής εγκατάστασης, στο Jupyter Notebook"""

# We generate an hourly datetime index for the current year
y_2022 = pd.date_range('2022-01-01', periods=8760, freq='60T')

# We load TMY data from the edited PVGIS TMY file
df_tmy = pd.read_csv(r"/content/tmy_41.095_24.230_2005_2020.csv", na_values='Null')

# We bind the datetime index to the TMY data
df_tmy.index = pd.to_datetime(y_2022, utc='True', format="%Y%m%d:%H%M")
df_tmy.index.name = 'dt'

"""### 2.1 Εξετάζουμε την εισαγόμενη έκδοση του αρχείου TMY."""

df_tmy.head()

"""Αυτό είναι ένα αντικείμενο ``pandas DataFrame``. Έχει πολλές εξαιρετικές ιδιότητες που είναι πέρα από το πεδίο του μαθήματος. Περιληπτικά, αποτελείται από γραμμές και στήλες, που σχηματίζουν κελιά, τα οποία φέρουν πληροφορία.
Συγκεκριμένα,
- στην στήλη ``dt`` εμφανίζεται η τρέχουσα Ημερομήνία και Ώρα,
- στην στήλη ``time(UTC)`` εμφανίζεται η Ημερομηνία και Ώρα λήψης μιας μέτρησης TMY,
- η στήλη ``T2m`` είναι η θερμοκρασία της αρμοσφαιρας στα 2μ υψόμετρο
- η στήλη ``RH`` είναι η Σχετική Υγρασία της αρμοσφαιρας στα 2μ υψόμετρο
- η στήλη ``G(h)`` είναι η GHI
- η στήλη ``Gb(n)`` είναι η DNI
- η στήλη ``Gd(h)`` είναι η DHI
- η στήλη ``IR(h)`` είναι η Infrared ακτινοβολία
- η στήλη ``WS10m`` είναι η Οριζόντια Ταχύτητα του Ανέμου στα 10μ υψόμετρο
- η στήλη ``WD10m`` είναι η Οριζόντια Κατεύθυνση του Ανέμου
- η στήλη ``SP`` είναι η Ατμοσφαιρική Πίεση

### 2.2 Αποτυπώνουμε την ετήσια μεταβολή της ολικής οριζόντιας ακτινοβολίας (GHI) σε γράφημα
"""

df_tmy['G(h)'].plot()
plt.rcParams['figure.figsize'] = [15, 10]
plt.ylabel('Irradiance (W/m**2)')
plt.title('GHI');

"""## 3. Υπολογισμός των ενδιάμεσων μεγεθών για την μοντελοποίηση ΦΒ ισχύος

Για να μπορέσουμε να υπολογίσουμε την ισχύ για όλες τις ώρες του αρχείου TMY, θα χρειαστεί να υπολογίσουμε:
* την  ``Hλιακή θέση`` (Solar Position)
* την  ``Eξωγήινη ακτινοβολία`` (DNI ET)
* την  ``Aέρια μάζα`` (Airmass)
* την  ``Διάχυτη ακτινοβολία ουρανού και εδάφους`` (POA Sky & Ground Diffuse)
* την  ``Γωνία πρόσπτωσης`` (ΑΟΙ)
* την  ``Συνολική προσπίπτουσα ηλιακή ακτινοβολία`` (Total POA)
* την  ``Θερμοκρασία ΦΒ κυψελών`` (Cell Temperature)

### 3.1 Ηλιακή θέση (Solar position)

Υπολογίζουμε την ``Ηλιακή θέση`` για όλες τις ώρες του αρχείου TMY.

Ο αλγόριθμος που χρησημοποιείται βασίζεται σε δημοσίευση των Reda and Andreas (2004).
"""

# Solar Position calculation
solpos = pvlib.solarposition.get_solarposition(df_tmy.index, sand_point.latitude, sand_point.longitude)

# Graph of Solar position variation in one week
solpos.loc['2022-06-22':'2022-06-28'].plot()
plt.ylabel('Degrees')
plt.title('Solar Position Angles');

"""### 3.2 Eξωγήινη ακτινοβολία (DNI ET)
Παρακάτω υπολογίζουμε την εξωγήινη ακτινοβολία, η οποία απαιτείται σε πολλά μοντέλα διάχυτης ακτινοβολίας επιπέδου-συστοιχίας (POA).

Η ηλιακή ακτινοβολία που προσπίπτει έξω από την ατμόσφαιρα της γης ονομάζεται εξωγήινη ακτινοβολία. Κατά μέσο όρο η εξωγήινη ακτινοβολία είναι 1361 Watt/meter2 (W/m2). Αυτή η τιμή ποικίλλει κατά ±3% καθώς η γη περιφέρεται γύρω από τον ήλιο. Η πλησιέστερη προσέγγιση της γης στον ήλιο συμβαίνει γύρω στις 4 Ιανουαρίου και είναι πιο μακριά από τον ήλιο γύρω στις 5 Ιουλίου.
"""

# the extraradiation function returns a simple numpy array
# instead of a nice pandas series. We will change this
# in a future version
dni_extra = pvlib.irradiance.get_extra_radiation(df_tmy.index)
dni_extra = pd.Series(dni_extra, index=df_tmy.index)

dni_extra.plot()
plt.ylabel('Irradiance in W / m^2')
plt.title('Extra terrestrial radiation');

"""### 3.3 Aέρια μάζα (Airmass)

Παρακάτω πραγματοποιείται ο υπολογσμός της Αέριας Μάζας για κάθε στιγμή του TMY.

Η μάζα του αέρα είναι ένα σχετικό μέτρο του οπτικού μήκους της ατμόσφαιρας. Στο επίπεδο της θάλασσας, όταν ο ήλιος βρίσκεται ακριβώς από πάνω (γωνία ζενίθ = 0), η μάζα του αέρα είναι ίση με 1. Καθώς η γωνία ζενίθ γίνεται μεγαλύτερη, η διαδρομή του άμεσου ηλιακού φωτός μέσω της ατμόσφαιρας μεγαλώνει και η μάζα του αέρα αυξάνεται. Αντίθετα, καθώς αυξάνεται το υψόμετρο, το πάχος της ατμόσφαιρας μειώνεται και η μάζα του αέρα μειώνεται.
"""

# Airmass calculation
airmass = pvlib.atmosphere.get_relative_airmass(solpos['apparent_zenith'])

# Weekly Air Mass Change
airmass.loc['2022-06-22':'2022-06-28'].plot();
plt.ylabel('Units')
plt.title('Airmass');

"""### 3.4.1 Διάχυτη ακτινοβολία ουρανού (POA Sky Diffuse)

Παρακάτω χρησιμοποιούμε το μοντέλο Hay-Davies για να υπολογίσουμε τη διάχυτη ακτινοβολία του Plane Of Array.
"""

poa_sky_diffuse = pvlib.irradiance.haydavies(surface_tilt, surface_azimuth,
                                             df_tmy['Gd(h)'], df_tmy['Gb(n)'], dni_extra,
                                             solpos['apparent_zenith'], solpos['azimuth'])

poa_sky_diffuse.plot()
plt.ylabel('Irradiance (W/m**2)')
plt.title('POA sky diffuse');

"""### 3.4.2 Διάχυτη ακτινοβολία εδάφους (POA Ground Diffuse)

Εδώ υπολογίζουμε τη διάχυση του εδάφους. Καθορίσαμε το albedo παραπάνω.
"""

poa_ground_diffuse = pvlib.irradiance.get_ground_diffuse(surface_tilt, df_tmy['G(h)'], albedo=albedo)

poa_ground_diffuse.plot()
plt.title('POA ground diffuse')
plt.ylabel('Irradiance (W/m**2)');

"""### 3.5 Γωνία πρόσπτωσης (ΑΟΙ)

Παρακάτω υπολογίζουμε την γωνία πρόσπτωσης της ηλιακής ακτινοβολίας στην ΦΒ συστοιχία, για κάθε ώρα του TMY. Σημειώστε ότι το AOI παίρνει και τιμές μεγαλύτερες από 90 μοίρες.
"""

# Angle of incident calculation
aoi = pvlib.irradiance.aoi(surface_tilt, surface_azimuth, solpos['apparent_zenith'], solpos['azimuth'])

# AOI variation graph for one week
aoi.loc['2022-06-22':'2022-06-28'].plot()
plt.title('AOI')
plt.ylabel('Angle of incidence (deg)');

"""### 3.6 Συνολική προσπίπτουσα ηλιακή ακτινοβολία (Total POA)

Παρακάτω υπολογίζουμε την συνολική προσπίπτουσα ηλιακή ακτινοβολία POA που φτάνει στην ΦΒ συστοιχία.
"""

poa_irrad = pvlib.irradiance.poa_components(aoi, df_tmy['Gb(n)'], poa_sky_diffuse, poa_ground_diffuse)

# Annual Total POA Variation graph
poa_irrad.plot()
plt.ylabel('Irradiance in W/m^2')
plt.title('Total POA');

# Total POA variation in a Week
dtstart = '2022-05-22'
dtend = '2022-05-28'
poa_irrad.loc[dtstart:dtend].plot()
plt.ylabel('Irradiance in W/m^2')
plt.title('Total POA from ' + dtstart + ' to ' + dtend);

"""### 3.7 Θερμοκρασία ΦΒ κυψελών (Cell Temperature)

Με την χρήση του Sandia PV Array Performance Model (SAPM) υπολογίζουμε την θερμοκρασία των ΦΒ κυψελών χρησημοποιώντας την προσπίπτουσα ακτινοβολία, την ατμοσφαιρική θερμοκρασία και την οριζόντια ταχύτητα ανέμου ως είσοδοι.
"""

thermal_params = pvlib.temperature.TEMPERATURE_MODEL_PARAMETERS['sapm']['open_rack_glass_polymer'] # For PV roof 'close_mount_glass_glass'
pvtemps = pvlib.temperature.sapm_cell(poa_irrad['poa_global'], df_tmy['T2m'], df_tmy['WS10m'], **thermal_params)

# Annual PV Cell Temperature Variation Graph
pvtemps.plot(color='red')
plt.title('PV Cell Temperature')
plt.ylabel('Temperature (C)');

"""## 4. Υπολογισμός της φωτοβολταϊκής DC ισχύος με την χρήση του μοντέλου μονής διόδου

### 4.1 Αρχικά ορίζουμε την ΦΒ μονάδα που σκοπεύουμε να χρησημοποιήσουμε και εισάγουμε τα χαρακτηριστικά της από το φύλλο δεδομένων του κατακευαστή της, στο Jupyter Notebook.
"""

# Sharp NU-JC375 Photovoltaic Module characteristics
myModule = pd.Series({'BIPV': 'N',
                      'Date': '1/3/2021',
                      'T_NOCT': 42.5,
                      'A_c': 1.85,
                      'N_s': 60,
                      'N_p': 2,
                      'I_sc_ref': 11.62,
                      'V_oc_ref': 41.08,
                      'I_mp_ref': 10.83,
                      'V_mp_ref': 34.63,
                      'alpha_sc': 0.057,# The short-circuit current temp coef of pvmod in units of %/C
                      'beta_oc': -0.263, # The open-circuit voltage temp coef of pvmod in units of %/C
                      'a_ref': 1.56588277884409, # From *** or SAM, The product of the usual diode ideality factor(unitless) number of cells in series (Ns), and cell thermal voltage at ref condi, in V.
                      'I_L_ref': 11.63415102775451,# From *** or SAM, The light-generated current (or photocurrent) at reference conditions, in amperes.
                      'I_o_ref': 0.0000000000456235, # From *** or SAM, The dark or diode reverse saturation current at reference conditions, in amperes.
                      'R_s': 0.14482947966706, # From *** or SAM, The series resistance at reference conditions, in ohms.
                      'R_sh_ref': 118.92552601952126, # From *** or SAM, The shunt resistance at reference conditions, in ohms.
                      'Adjust': 15.24483516970799, # From *** or SAM,
                      'gamma_r': -0.347,
                      'Version': 'NRELv1',
                      'PTC': 'nan',
                      'Technology': 'Mono-c-Si',
                      'Name': 'SHARP_NU_JC375'})

# *** W. De Soto, S.A. Klein, W.A. Beckman, Improvement and validation of a model for photovoltaic array performance, Solar Energy, Volume 80, Issue 1, 2006, Pages 78-88, ISSN 0038-092X, https://doi.org/10.1016/j.solener.2005.06.010.

"""### 4.2 Υπολογισμός της ισχύος στην έξοδο μιας ΦΒ μονάδας"""

# Εξάγουμε τις πέντε παραμέτρους σε πρότυπες συνθήκες...
d = {k: myModule[k] for k in ['a_ref', 'I_L_ref', 'I_o_ref', 'R_sh_ref', 'R_s']}

# ... και τις εισάγουμε στο μοντέλο DeSoto ώστε να υπολογίσουμε τις πέντε παραμέτρους για κάθε ώρα του ΤΜΥ
photocurrent, saturation_current, resistance_series, resistance_shunt, nNsVth = (
    pvlib.pvsystem.calcparams_desoto(poa_irrad.poa_global,
                                     pvtemps,
                                     myModule['alpha_sc'],
                                     EgRef=1.121,
                                     dEgdT=-0.0002677, **d))

# ... και εφόσον γνωρίζουμε πλέον τις πέντε παραμέτρους για κάθε ώρα του έτους, υπολογ΄ίζουμε την ΦΒ ισχύ μιας μονάδας για κάθε ώρα του ΤΜΥ
single_diode_out = pvlib.pvsystem.singlediode(photocurrent, saturation_current,
                                              resistance_series, resistance_shunt, nNsVth)

# Annaul Variation of the PV power output from a single PV module
single_diode_out[['p_mp']].plot()
plt.title('DC Power Output from a single PV module')
plt.ylabel('DC Power (W)');

# Variation of the PV power output from a single PV module for one Week
dtstart = '2022-05-22'
dtend = '2022-05-28'
single_diode_out[['p_mp']].loc[dtstart:dtend].plot()
plt.title('DC Power Output from a single PV module from '+ dtstart + ' to ' + dtend)
plt.ylabel('DC Power (W)');

"""### 4.3 Δημιουργία καμπυλών Έντασης - Τάσης της ΦΒ μονάδας"""

cases = [(1000, 25), (800, 25), (600, 25), (400, 25), (200, 25)]

conditions = pd.DataFrame(cases, columns=['Geff', 'Tcell'])

# adjust the reference parameters according to the operating
# conditions using the De Soto model:
IL, I0, Rs, Rsh, nNsVth = pvsystem.calcparams_desoto(
    conditions['Geff'],
    conditions['Tcell'],
    alpha_sc= myModule['alpha_sc'],
    a_ref= myModule['a_ref'],
    I_L_ref= myModule['I_L_ref'],
    I_o_ref= myModule['I_o_ref'],
    R_sh_ref= myModule['R_sh_ref'],
    R_s= myModule['R_s'],
    EgRef= 1.121,
    dEgdT= -0.0002677
)

# plug the parameters into the SDE and solve for IV curves:
curve_info = pvsystem.singlediode(
    photocurrent=IL,
    saturation_current=I0,
    resistance_series=Rs,
    resistance_shunt=Rsh,
    nNsVth=nNsVth,
    ivcurve_pnts=100,
    method='lambertw'
)
# plot the calculated curves:
plt.figure()
for i, case in conditions.iterrows():
    label = (
        "$G_{eff}$ " + f"{case['Geff']} $W/m^2$\n"
        "$T_{cell}$ " + f"{case['Tcell']} $C$"
    )
    plt.plot(curve_info['v'][i], curve_info['i'][i], label=label)
    v_mp = curve_info['v_mp'][i]
    i_mp = curve_info['i_mp'][i]
    # mark the MPP
    plt.plot([v_mp], [i_mp], ls='', marker='o', c='k')

plt.legend(loc=(1.0, 0))
plt.xlabel('Module voltage [V]')
plt.ylabel('Module current [A]')
plt.title(myModule['Name']);

"""### 4.4 Υπολογισμός ισχύος στην έξοδο της ΦΒ συστοιχίας  
Πολλαπλασιάζουμε την ισχύ της μίας ΦΒ μονάδας επί τον συνολικό αριθμό ΦΒ πανέλων της συστοιχίας και προκύπτει η ισχύς στην έξοδο της ΦΒ συστοιχίας, πριν τον αντιστροφέα. Διορθώνουμε το αποτέλεσμα πολλαπλασιάζοντας περαιτέρο με έναν συντελεστή απωλειών.
"""

# Υπολογισμός συνολικής ισχύος της ΦΒ συστοιχίας πριν από τον Inverter
sdo = single_diode_out

sdo['Total_Loss'] = 0.03   # <--- Εδώ ορίζουμε το ποσοστό των συνολικών απωλειών (e.g. soiling, glass reflection etc.)

sdo['PVArray_Module_Count'] = 16   # <--- Εδώ ορίζουμε τον συνολικό αριθμό ΦΒ μονάδων της συστοιχίας

# Calculation of total PV array power
sdo['PVArray_Power_Output'] = np.round(sdo['PVArray_Module_Count'] * sdo['p_mp'] * (1.0 - sdo['Total_Loss']), 3)
# Descriptive Statistics
sdo['PVArray_Power_Output'].describe()

"""## 5. Υπολογισμός της AC ισχύος της ΦΒ συστοιχίας, μετά τον αντιστροφέα

### 5.1 Διαστασιολόγηση του Inverter  
Συνήθως σε περιοχές με περιορισμένο ηλιακό δυναμικό, ως ονομαστική μέγιστη ισχύς στην έξοδο του αντιστροφέα (Rated Inverter Power) ορίζεται περίπου το 80-85 % της ονομαστικής ενεργής ισχύος της ΦΒ συστοιχίας. Για παράδειγμα, όταν η εγκατεστημένη ισχύς μιας ΦΒ συστοιχίας είναι 10000Wp τότε χρησημοποιείται inverter με ισχύ 8000W, διότι η πρόσπίτουσα στη ΦΒ συστοιχία ακτινοβολία, ελάχιστες φορές μεσα σε ένα έτος πλησιάζει ή ξεπερνά τα 1000W/m2.
  
Ωστόσο σε περιοχές με πλούσιο ηλιακό δυναμικό δεν ιχύει πάντα το ίδιο. Σε αυτές τις περιπτώσεις εξετάζουμε διαθέσιμους αντιστροφείς ανάλογης ισχύος με την εγκατεστημένη ισχύ της ΦΒ συστοιχίας, εκτιμώντας το ποσοστό της αποριπτόμενης ισχύος από τον αντιστροφέα. Επιλέγουμε τελικά τον αντιστροφέα με το χαμηλότερο ποσοστό απόρρηψης, συνυπολογίζοντας και το κόστος του.
"""

# Select Inverter AC Power Output (Rated) in Watt

inv_power = 6000.0   # <--- Εδώ δοκιμάζουμε την ισχύ του αντιστροφέα

inverted = np.round(sdo['PVArray_Power_Output'][sdo['PVArray_Power_Output'] <= inv_power].sum()/1000, 3)
clipped = np.round(sdo['PVArray_Power_Output'][sdo['PVArray_Power_Output'] > inv_power].sum()/1000, 3)
print("Inverted = ", inverted, "Clipped = ", clipped, "percentage = ", np.round(100 * clipped / inverted, 2))

"""### 5.2 Επιλογή ενός διαθέσημου αντιστροφέα από την βάση δεδομένων του SAM  
Προσέχουμε τα χαρακτηριστικά του αντιστροφέα να ανταποκρίνονται στις απαιτήσεις της εγκατάστασής μας. Για παράδειγμα ελέγχουμε τις τάσεις λειτουργίας του αντιστροφέα ή αν απαιτείται 3φασικός ή μονοφασικός αντιστροφέας κτλ.
"""

sapm_inverters = pvlib.pvsystem.retrieve_sam('sandiainverter')
for i in sapm_inverters.columns:
    print(i)

# Επιλογή κατάλληλου αντιστροφέα από την παραπάνω βάση δεδομένων
sapm_inverter = sapm_inverters['Fronius_International_GmbH__Fronius_Primo_6_0_1_208_240__240V_']

# Υπολογισμός της συνολικής ισχύος στην έξοδο του Αντιστροφέα
p_acs = pd.DataFrame()
