"""## 6. Αλγόριθμος Διαχείρισης Ενέργειας

### 6.1 Περιγραφή του Αλγορίθμου
Ο αλγόριθμος διαχειρίζεται την κατάσταση της ενέργειας (SoE) στην μπαταρία λαμβάνοντας υπόψη την ισχύ εξόδου του φωτοβολταϊκού (PV), το φορτίο και την κατάσταση της ίδιας της μπαταρίας. Λαμβάνει αποφάσεις με βάση αυτές τις παραμέτρους για να χειριστεί τέσσερις διαφορετικές περιπτώσεις, διασφαλίζοντας την ενεργειακή απόδοση του συστήματος αποφεύγοντας παράλληλα την εξάντληση της μπαταρίας.

Οι τέσσερις περιπτώσεις είναι οι εξής:

*   Case A: Η ισχύς εξόδου PV υπερβαίνει το φορτίο και η μπαταρία είναι πλήρως φορτισμένη. Σε αυτή την περίπτωση, η πλεονάζουσα ενέργεια θεωρείται απόβλητο καθώς η μπαταρία δεν μπορεί να αποθηκεύσει περισσότερη ενέργεια.

*   Case B: Η ισχύς εξόδου PV υπερβαίνει το φορτίο, αλλά η μπαταρία δεν είναι πλήρως φορτισμένη. Εδώ, η πλεονάζουσα ενέργεια αποθηκεύεται στην μπαταρία.

*   Case C: Το φορτίο υπερβαίνει την ισχύ εξόδου PV, αλλά η μπαταρία έχει αρκετή αποθηκευμένη ενέργεια για να καλύψει την έλλειψη. Σε αυτή την περίπτωση, η μπαταρία παρέχει την απαραίτητη ισχύ.

*   Case D: Το φορτίο υπερβαίνει την ισχύ εξόδου PV και η μπαταρία δεν έχει αρκετή αποθηκευμένη ενέργεια. Το σύστημα θα προσπαθήσει να δημιουργήσει εφεδρική ισχύ ενώ εξετάζει την απόδοση του συστήματος.

### 6.2 Διάγραμμα του Συστήματος

![diagramma systhmatos.png](data:image/png;base64,)

### 6.3 Ο κώδικας του Αλγορίθμου

Οι αρχικές συνθήκες και οι τιμές των μεταβλητών μας.
"""

ninv = 0.8 # αποτελεσματικότητα του συστήματος
nbat = 0.9 # απόδοση μπαταρίας
Bnec = 10 * 3600 # ονομαστική χωρητικότητα μπαταρίας σε joules
DOD = 0.6 # Βαθμός Αποφόρτισης

# αρχικοποίηση μεταβλητών
pload = 2500 # αρχικό φορτίο
ppv = p_acs.loc[dtstart:dtend].values # ωριαία απόδοση ισχύος
Ebat = [Bnec] * len(ppv) # έναρξη με μια πλήρως φορτισμένη μπαταρία
Ewaste = [0] * len(ppv) # σπατάλη ενέργειας
soe = [100] * len(ppv) # κατάσταση της ενέργειας της μπαταρίας

# initialize Pbackup_max as 1.2 * pload to ensure it has a higher value than pload
Pbackup_max = 1.2 * pload

# Initialize lists for Esur, Eshort
Ebalance = [0] * len(ppv)

"""Η προσομοίωση εκτελείται για μια συγκεκριμένη περίοδο (από τις 22 Μαΐου 2022 έως τις 28 Μαΐου 2022) και ακολουθεί ο κώδικας με τον βρόγχο που περιέχει τον αλγόριθμο."""

# επανάληψη σε ώρες
t = 1
while t < len(ppv):
    # εάν υπάρχει πλεόνασμα
    if ppv[t] > pload:
        # εάν η μπαταρία είναι πλήρως φορτισμένη (Case A)
        if soe[t-1] >= 100:
            Esur = ppv[t] - (pload / ninv)
            Ebat[t] = Ebat[t-1]
            Ewaste[t] = Esur
            soe[t] = soe[t-1]
            Ewaste[t] = Esur
            Ebalance[t] = Esur
        # εάν η μπαταρία δεν είναι πλήρως φορτισμένη (Case B)
        else:
            Esur = ppv[t] - (pload / ninv)
            Ebat[t] = Ebat[t-1] + Esur * nbat
            Ewaste[t] = Ebat[t] - min(Ebat[t], Bnec)
            soe[t] = min(Ebat[t], Bnec) * 100 / Bnec
            Ewaste[t] = Esur
            Ebalance[t] = Esur
    # αν υπάρχει έλλειψη
    else:
        # ελέγξτε αν η μπαταρία έχει αρκετή ενέργεια για να καλύψει την έλλειψη (Case C)
        if soe[t-1] > (100 - DOD * 100):
            Eshort = ppv[t] - (pload / ninv)
            Ebat[t] = Ebat[t-1] + Eshort
            Ewaste[t] = 0
            soe[t] = min(Ebat[t], Bnec) * 100 / Bnec
            Ewaste[t] = 0
            Ebalance[t] = Eshort
        # εάν η μπαταρία δεν έχει αρκετή ενέργεια (Case D)
        else:
            while soe[t] <= 80 and t < len(ppv) - 1:
                Esur = ppv[t]
                Pbackup_bat = max(0, Pbackup_max + Eshort) * ninv
                Ebat[t] = Ebat[t-1] + Pbackup_bat + Esur
                Ewaste[t] = 0
                soe[t] = min(Ebat[t], Bnec) * 100 / Bnec
                Ewaste[t] = 0
                Ebalance[t] = Eshort
                # επόμενο χρονικό βήμα στον εσωτερικό βρόγχο
                t += 1

    # επόμενο χρονικό βήμα στον βρόγχο
    t += 1

"""## 6.4 Τα ευρήματα του αλγόριθμου σε γραφήματα

Το γράφημα που προκύπτει απεικονίζει την κατάσταση της ενέργειας (SoE) στην μπαταρία με την πάροδο του χρόνου. Ο άξονας x αντιπροσωπεύει την ώρα λειτουργίας, ενώ ο άξονας y αντιπροσωπεύει το SoE ως ποσοστό. Το SoE μειώνεται όταν το φορτίο είναι υψηλότερο από την έξοδο ισχύος των φωτοβολταϊκών και η μπαταρία πρέπει να παρέχει ισχύ. Αντίθετα, το SoE αυξάνεται όταν η ισχύς εξόδου των φωτοβολταϊκών είναι υψηλότερη από το φορτίο, επιτρέποντας την υπερβολική ισχύ για τη φόρτιση της μπαταρίας.
"""

# Convert soe list to pandas Series with the same index as ppv
soe_series = pd.Series(np.array(soe, dtype=float), index=p_acs.loc[dtstart:dtend].index)

# Διάγραμμα SoE (ημερομηνίες & ώρες)
fig, ax = plt.subplots()

color = 'tab:blue'
ax.set_title('Κατάσταση Ενέργειας μέσα στην Εβδομάδα')
ax.set_xlabel('Ημερομηνία και Ώρα')
ax.set_ylabel('Κατάσταση Ενέργειας (%)', color=color)
ax.plot(soe_series.index, soe_series.values, color=color, label='State of Energy')
ax.tick_params(axis='y', labelcolor=color)
ax.legend(loc='upper right')
ax.xaxis.set_major_locator(mdates.DayLocator())
ax.xaxis.set_minor_locator(mdates.HourLocator(interval=6))
ax.xaxis.set_major_formatter(mdates.DateFormatter('\n%d/%m/%Y'))
ax.xaxis.set_minor_formatter(mdates.DateFormatter('%H:%M'))

fig.tight_layout()
plt.show()

"""Το Ενεργειακό Ισοζύγιο (Ebalance) αντιπροσωπεύει τη διαφορά μεταξύ της ενέργειας που παράγεται από το φωτοβολταϊκό σύστημα (ppv) και της ενέργειας που απαιτείται από το φορτίο (pload), λαμβάνοντας υπόψη την απόδοση του μετατροπέα (ninv). Όταν το ενεργειακό ισοζύγιο είναι θετικό, σημαίνει ότι το σύστημα παράγει περισσότερη ενέργεια από αυτή που χρειάζεται το φορτίο (Esur). Όταν είναι αρνητικό, το φορτίο απαιτεί περισσότερη ενέργεια από αυτή που μπορεί να παράγει το σύστημα (Eshort). Η σύγκριση αυτού με την Κατάσταση Ενέργειας, η οποία δείχνει το τρέχον επίπεδο ενέργειας της μπαταρίας, μπορεί να δώσει πληροφορίες για το πώς το πλεόνασμα ή η έλλειψη ενέργειας επηρεάζει την κατάσταση φόρτισης της μπαταρίας. Για παράδειγμα, ένα θετικό ενεργειακό ισοζύγιο μπορεί να οδηγήσει σε αύξηση της Ενεργειακής Κατάστασης, υποδεικνύοντας ότι η μπαταρία φορτίζεται."""

# Convert Ebalance to pandas Series with the same index as ppv
ebalance_series = pd.Series(np.array(Ebalance, dtype=float), index=p_acs.loc[dtstart:dtend].index)

fig, ax1 = plt.subplots()

color = 'tab:orange'
ax1.set_xlabel('Ημερομηνία και Ώρα')
ax1.set_ylabel('Ενεργειακό Ισοζύγιο (W)', color=color)
ax1.plot(ebalance_series.index, ebalance_series.values, color=color, label='Energy Balance')
ax1.tick_params(axis='y', labelcolor=color)
ax1.legend(loc='upper left')
ax1.xaxis.set_major_locator(mdates.DayLocator())
ax1.xaxis.set_minor_locator(mdates.HourLocator(interval=6))
ax1.xaxis.set_major_formatter(mdates.DateFormatter('\n%d/%m/%Y'))
ax1.xaxis.set_minor_formatter(mdates.DateFormatter('%H:%M'))

ax2 = ax1.twinx()

color = 'tab:blue'
ax2.set_ylabel('Κατάσταση Ενέργειας (%)', color=color)
ax2.plot(soe_series.index, soe_series.values, color=color, label='SoE')
ax2.tick_params(axis='y', labelcolor=color)
ax2.legend(loc='upper right')

fig.tight_layout()
plt.show()

"""Η Σπατάλη Ενέργειας (Ewaste) αντιπροσωπεύει την ενέργεια που έχει παραχθεί αλλά δεν μπορούσε να χρησιμοποιηθεί ή να αποθηκευτεί, για παράδειγμα, όταν η μπαταρία είναι πλήρως φορτισμένη (SoE = 100%) και το σύστημα εξακολουθεί να παράγει ενέργεια. Η σύγκριση αυτού με την Κατάσταση Ενέργειας μπορεί να δείξει την επίδραση της σπατάλης ενέργειας στην κατάσταση φόρτισης της μπαταρίας. Για παράδειγμα, μια αύξηση της σπατάλης ενέργειας μπορεί να αντιστοιχεί στο ότι η Κατάσταση Ενέργειας παραμένει σταθερή στο 100%, υποδηλώνοντας ότι η μπαταρία δεν είναι σε θέση να αποθηκεύσει την περίσσεια ενέργειας."""

